// import './main.css';


import React from "react";

import groceries from './images/stock/groceries1.png';
import household from './images/stock/household.png'
import  { useState,useEffect } from 'react';

function Stock() {
  return (        
    <main className='container top2'>
        <div className='row left'>
            <h5 className='col'>Stock</h5>
        </div>

        <div className='row border'>
              <button className='col'>      
              <i class="fas fa-lemon button-img"></i><br></br>
                Groceries                                  
              </button>

              <button className='col border'>
              <i class="fas fa-soap button-img"></i><br></br>
                    Household
              </button>

        </div>


    </main>            
  );
}

export default Stock;
